package main

import (
	"fmt"
	"strings"
)

func main() {

	// s := ""
	s := "11101000010001001100010110011100010110001110011011011"
	fmt.Printf("Output: %d\n", countBinarySubstrings(s))
}

func countBinarySubstrings(s string) int {
	cntt := 0
	cnt0, cnt1 := 0, 0
	prev := ""
	for i := 0; i < len(s); i++ {
		if s[i:i+1] == "0" {
			cnt0 = cnt0 + 1
		} else {
			cnt1 = cnt1 + 1
		}
		if prev != s[i:i+1] && prev != "" {
			cntt = cntt + 1
			if s[i:i+1] == "0" {
				cnt0 = 1
			} else {
				cnt1 = 1
			}
			prev = s[i : i+1]
		} else if prev == s[i:i+1] {
			if (prev == "0" && cnt0 <= cnt1) || (prev == "1" && cnt0 >= cnt1) {
				cntt = cntt + 1
			}
		} else {
			prev = s[i : i+1]
		}

	}
	return cntt
}

func countBinarySubstringsSlow(s string) int {
	cnt := 0
	substr := ""
	for i := 1; i <= len(s)/2; i++ {
		substr = strings.Repeat("0", i) + strings.Repeat("1", i)
		cnt = cnt + strings.Count(s, substr)
		substr = strings.Repeat("1", i) + strings.Repeat("0", i)
		cnt = cnt + strings.Count(s, substr)
	}
	return cnt
}
